import { Link } from 'react-router-dom'

export default function Home() {
  useEffect()
  return (
    <div>
      <div><Link to="/create">创建单选</Link></div>
      <div><Link to="/create?multiSelect">创建多选</Link></div>
    </div>
  )
}
